import React from 'react';
import './Peace.css';

function Peace() {
    return (
        <div className="peace-container">
            <div className="left-ellipse"></div>
            
            <div className="peace-content">
                <h2 className="peace-heading">Your Peace of Mind</h2>
                <p className="peace-text">
                    Through our conversion-focused strategies, we ensure that property seekers are not just visitors, 
                    but engaged prospects ready to make their next move in the real estate market
                </p>
                <button className="peace-button">Get started</button>
            </div>
            
            <div className="right-ellipse"></div>
        </div>
    );
}

export default Peace;
